import React from "react";
import InsidePassageBigTopImage from './res/insidepassagebigtop.jpg';
import './Tile.css'

const InsidePassageBigTop = () => {
    return (
        <img className="myTileImg" src={InsidePassageBigTopImage}/>
    )
};

export default InsidePassageBigTop;
